class Node:
    def __init__(self,data, next =None):
        self.data = int(data)
        self.next = next
        
class Stack:
    
    def __init__(self):
        self.head =None
    
    def push(self,element):
        if self.head == None:
            self.head = Node(element)
        else:
            newNode = Node(element)
            newNode.next = self.head
            self.head = newNode
    
    def toPrint(self):
        aux = self.head
        while(aux.next!=None):
            print(aux.data,"->",end=" ")
            aux = aux.next
        print(aux.data)
    
    def CalculateAverage(self):
        aux = self.head
        average = 0
        index =0
        while(aux!=None):
            average+=aux.data
            aux = aux.next
            index+=1
        return average/index  

def main():
     myPila =Stack()
     myPila.push(1)
     myPila.push(2)
     myPila.push(3)
     myPila.push(4)
     myPila.push(5)
     myPila.toPrint()
     average = myPila.CalculateAverage()
     print(average)

if __name__=='__main__':
    main()

